import React, { useEffect, useState } from 'react';

const Home=()=>{

    const [news,setNews]=useState('');

    useEffect(()=>{
        const callHome=async()=>{

            await fetch('/home')
            .then(res=>res.json())
            .then(data=>{
                console.log(data);
                setNews(data)})
            .catch(err=>console.log(err))
        }
        callHome();
    },[]);


    return(
        <h1>{news.heading}</h1>
    );

}

export default Home;
